Kakailanganin mo:
- pasta tubes o anumang malaking pasta - 500 g;
- tuyo na pulang alak - 150 ml;
- fillet ng manok - 500 g;
- keso - 150 g;
- mga kamatis na pinatuyong araw - 100 g;
- langis ng gulay - 6 na kutsara;
- sibuyas - 2 mga PC.;
- bawang - 3 cloves;
- tomato juice - 400 ml;
- pinatuyong basil - 1 kutsara;
- asin, paminta - sa panlasa.
Pagluluto
- Magluto ng malaking pasta hanggang sa handa na ang kalahati, banlawan ang mga ito.
- Grate ang keso.
- Tinadtad ang sibuyas at bawang.
- G
...
 "Paghurno" sa loob ng 45 minuto.
Ang Casserole sa isang mabagal na kusinilya ay lumiliko ang makatas at malambot, at ang sangkap ng gulay ay nagdaragdag ng iba't-ibang sa pamilyar na lasa.
Pasta karne kaserol ay perpekto para sa isang masayang hapunan o hapunan para sa buong pamilya. Upang mabawasan ang nilalaman ng calorie ng tapos na ulam, pumili ng low-fat cream, at palitan ang karne ng tinadtad na baboy na may veal o manok. Maglagay ng mas maraming gulay - gagawing mas malambot ang kaserol.
